import {
  Button,
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
  DialogTitle
} from "@material-ui/core";

class NewUser extends Component {
  constructor(props) {
    super(props);
    this.pr = props.parentState;
    this.state = {
      openDialog: false
    };
    this.registerUser = this.registerUser.bind(this);
  }

  handleClickOpen = () => {
    this.setState({ openDialog: true });
